function Dashboard(){

    window.onload = function load (){
      if(localStorage.getItem("name")=="" || localStorage.getItem("name")==null ){
        window.location.href="/Signup";
      }
      var view = document.querySelector("#name")

      console.log(view);

      view.innerHTML = localStorage.getItem("name").toUpperCase()+" "+localStorage.getItem("lastname").toUpperCase();


    }


    return(
      <div>
        <h2 style={{textAlign:"center"}}>Hello, welcome Agent <span id="name"> </span> </h2>
        <p className="names" id="nn3"> </p>
      <div id="container">


        <div className="personal information" style={{textAlign:"left"}}>
          <p>Fullname:{" "+localStorage.getItem("name")+""}  {localStorage.getItem("lastname")}<br></br></p>
          <p>State Of Origin: {""+localStorage.getItem("SOO")}</p>
          <p>Age: {""+localStorage.getItem("age")}</p>
          <p>Jobtype: {""+localStorage.getItem("jobtype")}</p>
          <p>Status: Unemployed</p>
          <p>Phone Number: {""+localStorage.getItem("pnumber")}</p>



        </div>



        </div>
        <div id="available_jobs">
        <h2 style={{textAlign:"center"}}>Available Jobs Near me</h2>
        </div>
      </div>
    );
  }

  export default Dashboard;
